const songReducer = (state = {}, action) =>{
    switch (action.type){
        case "ADD":
        return ({
            ...state,
            todos: [
                    ...state.songs,
                    {
                        id: action.payload.id,
                        name: action.payload.name,
                        url: action.payload.url,
                        source: action.payload.source,
                        priority: action.payload.priority
                    }
                    ]
            })
    }
}   
export default songReducer;
